FOSTER HOME:
Fairly timid; " gentle soul and LOVES the outdoors, particularly going for walks"; foster thinks she'd 'do best in a home with a resident dog to show her the ropes because she's shy'; 

Update 1/28/21-- Doing MUCH better with crate training; first week she wouldn't be able to settle for an hour but it's much less time now with the help of a kong/mealtime in the crate; LOVES to chew -- nylabones and stuffed animals are key; working on leash training as she can get overly excited about dogs and scared of humans; foster is working on clicker training with her and she's reading the body language of the resident dog to know when everything is okay and it's helping; going up the stairs now but definitely in part to the resident dog hleping; 

2/15/21 -- We have been testing Caramel with meeting friendly strangers since shes so shy and shes been with us for a few weeks now. She was very afraid of meeting a larger gentleman with a beard wearing a hoodie, so she may need some additional training in order to be around certain strangers. Shes doing well with the separation anxiety training, and is a high-energy dog so requires lots of playtime and long walks. Were still working on her leash training as well since shes a big puller! Shes doing well with basic commands such as Sit and Touch.

Non-stop playing; very active and high energy -- doing well becausae he has a resident dog to play with but will need an equally playful dog or dog parks every day; 
Foster flagged that there have three incidents in the home of concern: 1. Around thanksgiving, family came over and Archer was behind a gate and he barked/growled at the people entering the home and when they reached over; he was able to meet them later on, attached to a leash 2. Was barking / jumping at the dog park towards other dogs -- foster thought it was agression so she left, but Ashley thinks (based on the body language described) it was either refereeing or an attempt to play cut short. 3. When the foster and Archer were sleeping on the couch, the foster woke up and startle Archer who snapped at the foster and got his chin - everyone was okay and Archer wasn't feeling well when this happened but is now on a caution on kids to be safe!! 

Brought back to LDAR due to ncreasingly leash reactive over the past couple of weeks. He recently knocked a man over when they came out of the elevator and wouldn't stop barking until they were back inside Ian's apartment. Archer does the same thing when encountering dogs on walks or around the building (barking and lunging, impossible to get him to refocus).

Exercise by foster -- 4 walks a day, leash training for 20 min, dog park 2x a week;

Second dog required on leash / in the home; very mouthy and loud in the dog park but does well with the dogs - she is not playing to be agressive, but could SOUND that way to other adopters beacuse she's growling barking. When given the opportunity she did not grab onto a dog or use her mouth beyond just putting it near/on the dog; when another dog reacted to her she continued to build that by reacting, but again didn't attack; 

VERY hyperfocused on dogs and humans to the point of not being able to be redirected 

Update 1/26/21 - started a 'step-up' socialization class (through the foster) with My Dog's Best Friend to try to eventually do some daycare there with a focus on better playing habits (not all dogs like to play rough) and leash training (not pulling/barking at other dogs, squirrels, and kids playing). Lives in a home with another dog and is exceptionally close with her - plays rough but never any guarding issues. Does well in the dog park (it's her happy place according to the foster) and due to an increase in training she's also starting to do better with human intros at the dog park; has a point where she needs to be removed to go home because she'll get too tired and then hyperocused on other dogs/humans; she does not like the crate but will tolerate it IF the other dog is in the home - without the resident dog she will bark/howl

Week of 2/1 the foster noted Iris was shy, cautious on leash, seemed to really like dogs but struggled at an overly compact dog park; team received video of Iris on leash and body language seemed that Iris needed a second dog but due to comments of struggling at the dog park, set up a meet and greet with Ashley's dog & Iris to see more in person. 

2/7: Iris & Ashley met at the dog park; Iris immediately perked up when she met Risa (Ashley's dog) and was attached at the hip as soon as they met - Iris was comfortable to explore, relaxed body language, high tail; Foster noted that Iris did well at the first dog park visit when there were dog savvy dogs and owners but the second dog park visit didn't go well with a lot of new dogs / large amount of dogs; likely that Iris was scared since she didn't have a 'primary' dog that she was living with to read the body language of and was already anxious. Second dog in the home officially added and no kids under 12; 

She is inquisitive so if there's a gap in the fence, she'll try to leave, but she's not a flight risk -- her first isntinct when scared is to run to her foster as opposed to runa way

Resource guards in the home towards the resident dog primarily; doesn't respect the woman in the relationship but the fosters have both been working to help her gain and stay in control; needs a lot of mental stimulation; 

Returned for resource guarding ; Training with PDS in process

Long-term foster exercise: daily dog park in the am for 45 min and multiple 15-20 min. walks each day; 
Recent foster exercise: two 40 min. walks a day and one 15 min walk; not doing dog parks (ashley is talking ot them about this); working on training daily and it's helping with walking, less pullling, and less barking at strangers; still needs help with people coming into and existing in the house when she doesn't konw them

lives with three humans, on crate rest so hasn't been doing dog walks or parks but doing well otherwiser, great in the crate; 
Update - 1/29 - Foster asked to move Ears because of reactivity toward the male roommate (who wasn't there for the first week or so of being in foster) and eventual noise complaints from neighbors due to her barking; tried to nip and lunge at the male in the home -- could sometimes be persuaded to settle in with them but it seemed sporadic when Ears was okay with this; started to be towards other members of the home (within about 12 hours of first asking for the move); currently looking for a foster that has no kids and a caution on men and multiple humans in the homeUpd

Update 2/15 - 4 walks a day 20 minutes per walk; aversion to men still;

Returned for 'biting and being too mouthy in the home, jumping to the point of knocking people over'; We made Cuation on kids because of this; 

Staff saw no signs of mouthiness, nippiness, or other behaviors -- but sent to foster and will report back

Met a cat in the office and was fearful but barked so might scare some cats if they're not confident; he backed away as he barked though.

In the first foster home was exhibiting some resource guarding / human reactivity -- lunge/barked at the kids entering the room/approaching the parents on the couch, reactive in the kitchen around food, etc.; never seemed to settle and reactions were escalating with each situation; Suspected that it was because there were too many humans in the home and older children (15-19) and not enough exercise - they weren't doing dog parks; LDAR consulted virutally with Positive Dog Solutions and they agreed so moved MIkey to a foster with only one human that was bale to do consistent exercise and crate training to help with boundaries; 

Second/New foster home -- thriving; no signs of reactivity to the point the foster hasn't seen any signs of reactivity we described; Does 3 miles a day on walks and a daily dog park trip; content to sit in the house while his foster works; doing well with training on basic tricks - sit, down, etc; struggling to maintain the furniture boundary; foster says Mikey 'craves exercise' and would love a foster home with a yard; entertains himself in the house with toys consistently; 

Update - 1/19: goes to the dog park frequently - struggles with jumping on them constantly which can cause other dogs to react, but Mikey is good; settles down in the crate after initial whining, fnatastic on walks and loves walking - pulls only for squirrles; foster noted that startling Mikey while he sleeps results in a reaction so definitely shouldn't be in a home with kids; Foster wants to stress exercse for him - long walk and nature hikes daily.

